import React from 'react';
import './App.css';
import { Outlet } from 'react-router-dom';
import {
  Button,
  Card,
  CardImg,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
} from 'reactstrap';
import NavBar from './navbar';

function Home() {
  return (
    <div className="div">
      <Outlet />
      <Card>
        <CardImg top width="100%" src="./joel.jpg" alt="banner" />
        <CardBody>
          <CardTitle className="h3 mb-2 pt-2 font-weight-bold text-secondary">
            Welcome to Joel Hilton's Movie Collection
          </CardTitle>
          <CardSubtitle
            className="text-secondary mb-3 font-weight-light text-uppercase"
            style={{ fontSize: '0.8rem' }}
          >
            Here you will find the best movies
          </CardSubtitle>

          <div>
            <img
              src="./joel.jpg"
              alt="Joel"
              className="position-relative img-fluid"
            ></img>
          </div>
          <Button color="success" className="font-weight-bold">
            View Profile
          </Button>
        </CardBody>
      </Card>
    </div>
  );
}

export default Home;
